import React from 'react';
impo

export default function Home() {
  return (
    <main>
      <div className="hero">
        <div className="left">
          <h1>Welcome to Our Website!</h1>
          <p>This is a simple website built with React.</p>
        </div>
        <div className="right">
          <img src="https://via.placeholder.com/400x300" alt="Placeholder" />
        </div>
      </div>
    </main>
  );
}
